// слайдер на главной
$(document).ready(function() {
    $(".slider2").owlCarousel({
        items: 1,
        slideSpeed: 500,
        loop: true,
        nav: true,
        animateOut: 'fadeOut',
        dotsClass: 'owl-dots_sl',
        dotClass: 'owl-dot_sl',
        navContainerClass: 'owl-nav_sl',
        navClass: ['owl-prev_sl', 'owl-next_sl'],
        navText: []
    });

    $(".recommend_c").owlCarousel({
        margin: 30,
        loop: true,
        nav: true,
        dotsClass: 'dots_c',
        dotClass: 'dot_c',
        navContainerClass: 'nav_c',
        navClass: ['prev_c', 'next_c'],
        navText: [],
        responsive: {
            0: {
                items: 1
            },
            480: {
                items: 2
            },
            750: {
                items: 3
            },
            970: {
                items: 4
            }
        }
    });

    // карусель "наши партнеры"
    $(".partners_c").owlCarousel({
        margin: 30,
        loop: true,
        nav: true,
        dotsClass: 'dots_pc',
        dotClass: 'dot_pc',
        navContainerClass: 'nav_pc',
        navClass: ['prev_pc', 'next_pc'],
        navText: [],
        responsive: {
            0: {
                items: 1
            },
            480: {
                items: 2
            },
            980: {
                items: 3
            },
            1279: {
                items: 4
            },
            1560: {
                items: 5
            }
        }
    });

    // googlemaps
    $('.map_open').click(function() {
        $('#map').toggleClass('map_2');
    });

    //табы в каталоге
    $(".tab_item").not(":first").hide();
    $(".wrapper .tab_catalog").click(function() {
        $(".wrapper .tab_catalog").removeClass("active_tab").eq($(this).index()).addClass("active_tab");
        $(".tab_item").hide().eq($(this).index()).fadeIn()
    }).eq(0).addClass("active_tab");



    var acc = document.getElementsByClassName("accordion");
    var i;

    for (i = 0; i < acc.length; i++) {
        acc[i].addEventListener("click", function() {
            this.classList.toggle("active");

            var panel = this.nextElementSibling;
            if (panel.style.display === "block") {
                panel.style.display = "none";
            } else {
                panel.style.display = "block";
            }
        });
    }

    // раскрыть каталог в моб. версии
    $(".catalog_low_menu_item").click(function() {
        $('.catalog_low_menu_2').slideToggle("slow");
        return false;
    });

    $('.menu-trigger').click(function() {
        $('.main_menu').slideToggle("slow");
        return false;
    });
    $(window).resize(function() {
        if ($(window).width() > 969) {
            $('.main_menu').removeAttr('style');
        }
    });

    // слайдер в карточке товара
    $('.slider-for').slick({
        slidesToShow: 1,
        slidesToScroll: 1,
        arrows: false,
        fade: true,
        asNavFor: '.slider-nav'
    });
    $('.slider-nav').slick({
        slidesToShow: 4,
        slidesToScroll: 1,
        asNavFor: '.slider-for',
        dots: false,
        centerMode: false,
        prevArrow: '',
        nextArrow: '',
        focusOnSelect: true
    });

    // третья часть меню
    $(".menu_line_2").click(function() {
        $('.dop_drop_menu').slideToggle("slow");
        return false;
    });

});